import './Testimonial.scss';

const Testimonial = () => {
  return (
    <div className="testimonial" id='testimonial'>
      <h1 className="tes-title">testimonial</h1>
      <div className="container">
        <div className="card">
          <div className="top"></div>
          <div className="center"></div>
        </div>
      </div>
    </div>
  )
}

export default Testimonial;
